who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"CRIMECRMCYTOTC":{"type":"number","alias":"2023 Total Crime Index","vintage":"2023","source":"AGS","units":null,"decimals":null,"definition":"The Total Crime Index provides an assessment of the relative risk of seven major crime types: murder, rape, robbery, assault, burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS."},"BASICFACTSFORMOBILEAPPSTOTPOPCY":{"type":"number","alias":"Population","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"GENDERMALESCY_P":{"type":"number","alias":"2023 Male Population: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Male Population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"GENDERFEMALESCY_P":{"type":"number","alias":"2023 Female Population: Percent","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Female Population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINCCY":{"type":"number","alias":"2023 Median Household Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"COMMUTEACSPUBTRAN_P":{"type":"number","alias":"2021 Workers 16+: Public Transportation (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Workers Age 16+ who primarily Took Public Transportation to work in the geographic area. Responders who used a different transportation method on different days were asked to specify their primary method; responders who used multiple methods in one trip were asked to specify the one used for the longest distance. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"EDUCATIONALATTAINMENTEDUCBASECY":{"type":"number","alias":"2023 Educational Attainment Base","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 base for Educational Attainment Age 25+. This base variable is used to calculate educational attainment percentages in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"EDUCATIONX11001X":{"type":"number","alias":"2023 Education","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Education</em> in the geographic area. Includes expected spending on primary, secondary, and vocational tuition and expenses, including finance/late/interest charges on student loans; equipment purchase or rental; school books and supplies; test preparation and tutoring. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"FOODX1002X":{"type":"number","alias":"2023 Food","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Food</em> in the geographic area. Includes expected spending on food at home or away from home. Esri’s Consumer Spendin sri","definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSEHOLDTOTALSAVGHHSZCY":{"id":"AVGHHSZ_CY","fullName":"HouseholdTotals.AVGHHSZ_CY","alias":"2023 Average Household Size","fieldName":"HOUSEHOLDTOTALSAVGHHSZCY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSEHOLDTOTALSAVGHHSZCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.CRIMECRMCYTOTC":{"id":"CRMCYTOTC","fullName":"crime.CRMCYTOTC","alias":"2023 Total Crime Index","fieldName":"CRIMECRMCYTOTC","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CRIMECRMCYTOTC","type":"esriFieldTypeDouble","vintage":"2023","source":"AGS","definition":"The Total Crime Index provides an assessment of the relative risk of seven major crime types: murder, rape, robbery, assault, burglary, larceny, and motor vehicle theft. It is modeled using data from the FBI Uniform Crime Report and demographic data from the Census and AGS."},"dataCollectionsCalculator.BASICFACTSFORMOBILEAPPSTOTPOPCY":{"id":"TOTPOP_CY","fullName":"basicFactsForMobileApps.TOTPOP_CY","alias":"Population","fieldName":"BASICFACTSFORMOBILEAPPSTOTPOPCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.BASICFACTSFORMOBILEAPPSTOTPOPCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.GENDERMALESCY_P":{"id":"MALES_CY_P","fullName":"Gender.MALES_CY_P","alias":"2023 Male Population: Percent","fieldName":"GENDERMALESCY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.GENDERMALESCY_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Male Population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.GENDERFEMALESCY_P":{"id":"FEMALES_CY_P","fullName":"Gender.FEMALES_CY_P","alias":"2023 Female Population: Percent","fieldName":"GENDERFEMALESCY_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.GENDERFEMALESCY_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Female Population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HEALTHMEDHINCCY":{"id":"MEDHINC_CY","fullName":"Health.MEDHINC_CY","alias":"2023 Median Household Income","fieldName":"HEALTHMEDHINCCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHMEDHINCCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.COMMUTEACSPUBTRAN_P":{"id":"ACSPUBTRAN_P","fullName":"commute.ACSPUBTRAN_P","alias":"2021 Workers 16+: Public Transportation (ACS 5-Yr): Percent","fieldName":"COMMUTEACSPUBTRAN_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.COMMUTEACSPUBTRAN_P","type":"esriFieldTypeDouble","vintage":"2017-2021","source":"ACS","definition":"ACS five-year estimate of the number of Workers Age 16+ who primarily Took Public Transportation to work in the geographic area. Responders who used a different transportation method on different days were asked to specify their primary method; responders who used multiple methods in one trip were asked to specify the one used for the longest distance. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.EDUCATIONALATTAINMENTEDUCBASECY":{"id":"EDUCBASECY","fullName":"educationalattainment.EDUCBASECY","alias":"2023 Educational Attainment Base","fieldName":"EDUCATIONALATTAINMENTEDUCBASECY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.EDUCATIONALATTAINMENTEDUCBASECY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 base for Educational Attainment Age 25+. This base variable is used to calculate educational attainment percentages in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.EDUCATIONX11001X":{"id":"X11001_X","fullName":"education.X11001_X","alias":"2023 Education","fieldName":"EDUCATIONX11001X","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.EDUCATIONX11001X","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Education</em> in the geographic area. Includes expected spending on primary, secondary, and vocational tuition and expenses, including finance/late/interest charges on student loans; equipment purchase or rental; school books and supplies; test preparation and tutoring. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.FOODX1002X":{"id":"X1002_X","fullName":"food.X1002_X","alias":"2023 Food","fieldName":"FOODX1002X","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.FOODX1002X","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Food</em> in the geographic area. Includes expected spending on food at home or away from home. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.TRANSPORTATIONX6001X":{"id":"X6001_X","fullName":"transportation.X6001_X","alias":"2023 Transportation","fiel
